import './App.css';
import Dashboard from "./components/Dashboard";
import {BrowserRouter as Router, Route} from "react-router-dom";
import AddBook from "./components/Book/AddBook";

function App() {
  return (
      <Router>
          <div>
              <Dashboard />

              <Route path="/addBook" component={AddBook} />
          </div>
      </Router>
  );
}

export default App;
